  const t2 = Date.now();
  if (t2 - t1 > 100) { while(true) {} } // Bei Debugger wird die Zeit l채nger
  
  // Toter Code zur Verwirrung
  const _ = Math.random() * 100; 
  if (_ > 999) console.log("dead");

  // Schl체ssel
  const k1 = 127, k2 = 46;
  
  // Entschl체sselungsschicht 1
  const e = "";
